s($,"aAn","alT",function(){var q="Ashtari-Jafari, Sahar",p="Heterobimetallic PtII-AuI Complexes Comprising Unsymmetrical 1,1-Bis(diphenylphosphanyl)methane Bridges: Synthesis, Photophysical, and Cytotoxic Studies",o="In the present work, a series of aryl-cycloplatinated(II) complexes with general formula [Pt(C^N)(Ar)(?1-dppm)], 1, [C^N = 7,8-benzoquinolinyl (bzq) or 2-phenylpyridinyl (ppy); Ar = C6F5 or p-MeC6H4, dppm = 1,1-bis(diphenylphosphanyl)methane] was employed in the reaction with AuCl(SMe2) in order to generate heterobimetallic PtII-AuI complexes, [Pt(C^N)(Ar)([Micro]-dppm)Au(Cl)], 2, featuring a dppm bridge between the metal centers. The expectation was to induce metallophilic character into the excited state and to reduce non-radiative deactivation pathways of the dangling auxiliary ?1-dppm ligand through molecular motions, to improve the photophysical properties. After characterization of the new complexes by means of NMR spectroscopy and X-ray crystallography technique, the photophysical properties of all the complexes were investigated by UV/Vis and photoluminescence spectroscopy. Both of the monometallic complexes and heterobimetallic products have shown to be luminescent in different states and temperature conditions. However, by addition of AuI, the impact on the photophysics of the heterobimetallic products in relation to the precursors with dangling dppm is minimal, a finding which can be attributed to the absence of a PtII-AuI bond in these compounds. Indeed, the character of the excited states of the monomer PtII complexes and their corresponding bimetallic PtII-AuI ones are similar, as confirmed by density functional theory (DFT) and time resolved DFT (TD-DFT) calculations. The cytotoxic activities of the compounds along with that of [ClAu([Micro]-dppm)AuCl] were evaluated against human breast cancer (MCF-7), human lung cancer (A549), human ovarian cancer (SKOV3) and non-tumorigenic epithelial breast (MCF-10A) cell lines. The highest activity was found for the heterometallic Pt-Au species, suggesting a cooperative effect of both metallic fragments. The most cytotoxic compound, i.e. [Pt(bzq)(p-MeC6H4)([Micro]-dppm)Au(Cl)], 2b, effectively causes cell death in MCF-7 cancer cell line by inducing apoptosis. Fluorescence microscopy experiments for 2a were performed.",n="10.1002/ejic.201801297",m="https://doi.org/10.1002/ejic.201801297",l="Shahsavari, Hamid R.",k="Moreno, M. Teresa",j="Fereidoonnezhad, Masood",i="Babadi Aghakhanpour, Reza",h="Kalantari, Foroogh",g="Mohammadpour, Mozhdeh",f="2019/03/14",e=2019,d="Heterobimetallic complexes",c="Bakker, Joost M.",b=2017,a="Kakanejadifard, Ali",a0="Shakourian-Fard, Mehdi",a1="Buma, Wybren Jan",a2="Waters, L. B. F. M.",a3=2015,a4="Tehrani, Zahra Aliakbar",a5=2014,a6="Interactions between noble metals and rare gases have become an interesting topic over the last few years. In this work, a computational study of the open-shell (d10s1) and closed-shell (d10s and d10s2) noble metals (M = Cu, Ag, and Au) with three heaviest rare gas atoms (Rg = Kr, Xe, and Rn) has been performed. Potential energy curves based on ab initio [MP2, MP4, QCISD, and CCSD(T)] and DFT functionals (M06-2X and CAM-B3LYP) were obtained for ionic and neutral AuXe complexes. Dissociation energies indicate that neutral metals have the lowest and cationic metals have the highest affinities for interaction with rare gas atoms. For the same metals, there is a continuous increase in dissociation energies (De) from Kr to Rn. The nature of bonding and the trend of De and equilibrium bond lengths (Re) have been interpreted by means of quantum theory of atoms in molecules, natural bond orbital, and energy decomposition analysis. ? 2013 Wiley Periodicals, Inc.",a7="Aliakbar Tehrani, Zahra",a8=2013,a9="Fattahi, Alireza",b0=2012,b1="Jebeli Javan, Marjan",b2=t.s,b3=H.a(["Asadi-Aghbolaghi, Narges","R\xc3\xbcger, Robert","Jamshidi, Zahra","Visscher, Lucas"],b2),b4=H.a(["jp0c00979_0007-8d2112c8-272b-4382-afd4-c73a7351ef79.gif"],b2),b5=$.aey()
return H.a([Z.b1('We study the quantum plasmonic features of gold and silver nanoparticles using TD-DFT+TB, a new density functional theory approach to the calculation of excited states, which combines a full DFT ground state with tight-binding approximations in the linear response calculation. In this framework, the optical properties of closed-shell Ag, Au and bimetallic Ag\xe2\u20ac"Au nanoparticles with tetrahedral symmetry (with 20, 56, 120, and 165 atoms) and icosahedral structure (with 13, 55, and 147 atoms) were obtained and compared to full linear response time-dependent density functional theory (TD-DFT) as a reference and also to time-dependent density functional based tight binding (TD-DFTB) as a low-cost alternative approach. We find an excellent agreement of TD-DFT+TB calculated absorption spectra with the TD-DFT reference with errors less than 0.15 eV in peak positions, while TD-DFTB shows larger errors of about 1 eV. The computational cost for the ground state calculation is identical for TD-DFT and TD-DFT+TB, but the excited state calculation becomes about a hundred times faster when applying the TB approximation and is then almost negligible for the overall timing of the calculation. In contrast to TD-DFTB, which can only be applied to element combinations for which a suitable DFTB parametrization is available, TD-DFT+TB can be applied to any combination of elements. To assess the accuracy of TD-DFT+TB for different combinations of atoms, the plasmonic properties of bimetallic clusters with different ratios of Ag and Au atoms were obtained and the trend of energy and intensity reproduced in good agreement with TD-DFT, which is not possible using TD-DFTB with standard parameter sets. AB  - We study the quantum plasmonic features of gold and silver nanoparticles using TD-DFT+TB, a new density functional theory approach to the calculation of excited states, which combines a full DFT ground state with tight-binding approximations in the linear response calculation. In this framework, the optical properties of closed-shell Ag, Au and bimetallic Ag\xe2\u20ac"Au nanoparticles with tetrahedral symmetry (with 20, 56, 120, and 165 atoms) and icosahedral structure (with 13, 55, and 147 atoms) were obtained and compared to full linear response time-dependent density functional theory (TD-DFT) as a reference and also to time-dependent density functional based tight binding (TD-DFTB) as a low-cost alternative approach. We find an excellent agreement of TD-DFT+TB calculated absorption spectra with the TD-DFT reference with errors less than 0.15 eV in peak positions, while TD-DFTB shows larger errors of about 1 eV. The computational cost for the ground state calculation is identical for TD-DFT and TD-DFT+TB, but the excited state calculation becomes about a hundred times faster when applying the TB approximation and is then almost negligible for the overall timing of the calculation. In contrast to TD-DFTB, which can only be applied to element combinations for which a suitable DFTB parametrization is available, TD-DFT+TB can be applied to any combination of elements. To assess the accuracy of TD-DFT+TB for different combinations of atoms, the plasmonic properties of bimetallic clusters with different ratios of Ag and Au atoms were obtained and the trend of energy and intensity reproduced in good agreement with TD-DFT, which is not possible using TD-DFTB with standard parameter sets.',"10.1021/acs.jpcc.0c00979","TD-DFT+TB: An Efficient and Fast Approach for Quantum Plasmonic Excitations","https://doi.org/10.1021/acs.jpcc.0c00979",b3,"2020/04/09",b4,b5[0],H.a(["Gold","Metal clusters","Plasmonics","Time Dependent density functional theory","Energy"],b2),2020),Z.b1("Surface-enhanced Raman spectroscopy is a highly sensitive phenomenon and a powerful fingerprint detection tool that reflects the small changes in polarizability on the pattern and intensity of Raman signals. The SERS enhancement signals elucidate with the surface-selection rules. In this regard, molecular configuration and adsorption orientation on the surface, in addition to the direction of external electric field, can lead to different patterns of SERS spectra. To evaluate how the variation of these features influences the pattern and reproducibility of the spectra, the chemical charge-transfer SERS spectra for pyridine on silver clusters are calculated for different field directions, tilt angles, and anchoring bond distances. The impact of external electric field direction versus the adsorbed tilt angle and Ag[Dash]N bond distance on the pattern of SERS-CT spectra is established by time-dependent excited-state gradient approximation and elucidated based on the deviation of ground- and excited-state properties from the optimized condition.","10.1021/acs.jpcc.1c02319","How Do Adsorbent Orientation and Direction of External Electric Field Affect the Charge-Transfer Surface-Enhanced Raman Spectra?","https://doi.org/10.1021/acs.jpcc.1c02319",H.a([q,"Jamshidi, Zahra"],b2),"2021/06/09",H.a(["jp1c02319_0008-4d40ce26-b29a-47ec-9479-f66aee2156da.gif"],b2),b5[0],H.a(["Electric Fields","Adsorption","Raman Spectroscopy","Chemical Structure","Chemical Calculations"],b2),2021),Z.b1(o,n,p,m,H.a([l,"Gim\xe9nez, Nora","Lalinde, Elena",k,j,i,"Khatami, Mehri",h,"Jamshidi, Zahra",g],b2),f,H.a([],b2),b5[3],H.a([d,"Platinum","Gold","Photophysics","Cytotoxicity","P ligands"],b2),e),Z.b1("Abstract The primary challenge of spectroscopic techniques in selective detection and characterization of tautomeric structures of DNA and RNA bases, and moreover, the accurate interpretation and explanation of the experimental results are the main motives of theoretical studies. Surface-enhanced Raman spectroscopy (SERS) can be a powerful approach to distinguish cytosine in the presence of its tautomers. For this respect, herein, the theoretical simulation of the SERS spectra of cytosine and its three most stable tautomers adsorbed on silver clusters is carried out. The calculations of SERS spectra is based on the excited-state energy gradient approximation as a well-established approach that gives us the knowledge about the properties of excited states and their effect on the pattern of spectra. The good consistency of this theoretical simulation in solution and also the gas phase with the experimental results is achieved and represents the capacity of the current theoretical investigations to interpret and supplement the experimental findings.","10.1002/jrs.5748","Theoretical simulation of surface-enhanced resonance Raman spectroscopy of cytosine and its tautomers","https://doi.org/10.1002/jrs.5748",H.a(["Sharafdini, Raziyeh",g,"Ramazani, Shapour","Jamshidi, Zahra"],b2),"2020/01/01",H.a([],b2),b5[1],H.a(["biomolecule","DNA","Raman spectroscopy","SERS","time-dependent DFT"],b2),2020),Z.b1("Since the discovery of surface-enhanced resonance Raman scattering (SERS), elucidating the charge-transfer (CT) mechanism has been a challenging and controversial process. Different theoretical models have been proposed to explain the effect of applied electrode potential on SERS-CT, but achieving a high-quality conserved trend of experimental observations and explaining the nature of the selective enhancement of the signals is not a trivial task and the results and conclusions are still in dispute. We investigated recently the performance of time-dependent excited-state gradient approximation under the effects of a uniform finite electric field in a simulation of the experimental spectra of pyridine on an Ag electrode. The singular patterns of the experimental spectra for symmetric and non-symmetric benzene-like derivative compounds and the consistent trends of enhancements of their signals under various electrode potentials motivated us to extend our simulation studies to 4-methylpyridine, pyrazine and pyrimidine molecules on silver metal clusters. For these molecules, selective enhancement and de-enhancement of totally symmetric ([Upsilon]6a, [Upsilon]9a and [Upsilon]8a) and non-totally symmetric ([Upsilon]6b and [Upsilon]8b) modes upon changing the field were obtained and matched well with experimental observations. The selective enhancement of each signal in a zero field was explained by means of excited-state vector gradients and excited-state charge density difference for the S0 [RightArrow] SCT transition. On-field calculations showed slight perturbations of the geometries and electronic structures of the molecules. These on-field calculations also directly affected the magnitude of specific excited-state vector gradients and dimensionless displacements, and moreover the patterns of the spectra. The results of this investigation provided insight into the nature of the selective enhancements of signals and may help researchers propose the selection rules of SERS-CT.","10.1039/C9CP05116C","Charge-transfer surface-enhanced resonance Raman spectra of benzene-like derivative compounds under the effect of an external electric field","https://doi.org/10.1039/C9CP05116C",H.a([q,"Khodabandeh, Mohammad Hassan","Jamshidi, Zahra"],b2),"2019",H.a([],b2),b5[2],H.a([],b2),e),Z.b1(o,n,p,m,H.a([l,"Gim\xe9nez, Nora","Lalinde, Elena",k,j,i,"Khatami, Mehri",h,"Jamshidi, Zahra",g],b2),f,H.a(["ejic201801297-toc-0001-m-7d260199-e891-4698-96e8-e0737d0a055d.png"],b2),b5[3],H.a([d,"Platinum","Gold","Photophysics","Cytotoxicity","P ligands"],b2),e),Z.b1("The unique plasmonic character of silver and gold nanoparticles has a wide range of applications, and tailoring this property by changing electronic and geometric structures has received a great deal of attention. Herein, we study the role of the quantum properties in controlling the plasmonic excitations of gold and silver atomic chains and rods. The influence of relativistic effects, scalar as well as spin-orbit, on the intensity and energy of plasmonic excitations is investigated. The intensity quenching and the red shift of energy in the presence of relativistic effects are introduced via the appearance of d orbitals directly in optical excitations in addition to the screening of s-electrons by mixing with the occupied orbitals. For the linear gold system, it will be demonstrated that by increasing the length the relativistic behavior declines and the contribution of d orbitals to the plasmonic excitations evidently decreases. Furthermore, silver atoms are doped in gold chains and rods (with two different arrangements) to realize how gold-silver interactions decrease the relativistic effects and enhance the intensity of collective excitations. Finally, to strengthen the plasmonic behavior of gold, the elongation of chain and doping with suitable atoms such as silver (with the classical plasmonic behavior) can be introduced as the manipulating ways to control the influence of scalar-relativistic and spin-orbit effects and, consequently, reinforce the plasmonic properties.","10.1021/acs.jpcc.8b12045","Influence of Scalar-Relativistic and Spin-Orbit Terms on the Plasmonic Properties of Pure and Silver-Doped Gold Chains","https://doi.org/10.1021/acs.jpcc.8b12045",H.a(["Khodabandeh, M. H.","Asadi-Aghbolaghi, N.","Jamshidi, Z."],b2),"2019/04/11",H.a(["jp-2018-12045u_0011-1280c67c-ee34-4b32-a178-5cb42b4c6fee.gif"],b2),b5[4],H.a([],b2),e),Z.b1("Coinage metal clusters are of great importance for a wide range of scientific fields, ranging from microscopy to catalysis. Despite their clear fundamental and technological importance, the experimental structural determination of copper clusters has attracted little attention. We fill this gap by elucidating the structure of cationic copper clusters through infrared (IR) photodissociation spectroscopy of Cun+-Arm complexes. Structures of Cun+ (n = 3-10) are unambiguously assigned based on the comparison of experimental IR spectra in the 70-280 cm-1 spectral range with spectra calculated using density functional theory. Whereas Cu3+ and Cu4+ are planar, starting from n = 5, Cun+ clusters adopt 3D structures. Each successive cluster size is composed of its predecessor with a single atom adsorbed onto the face, giving evidence of a stepwise growth.","10.1021/acs.jpclett.9b00539","Structures of Cun+ (n = 3-10) Clusters Obtained by Infrared Action Spectroscopy","https://doi.org/10.1021/acs.jpclett.9b00539",H.a(["Lushchikova, Olga V.","Huitema, Douwe M. M.","L\xf3pez-Tarifa, Pablo","Visscher, Lucas","Jamshidi, Zahra",c],b2),"2019/05/02",H.a(["jz-2019-00539y_0001-f6f9b486-08a6-4730-b277-40a568d8e5ce.gif","jz-2019-00539y_0002-ab30de4e-cc42-4078-bb7b-45fc51a81c28.gif"],b2),b5[5],H.a([],b2),e),Z.b1("Abstract The interactions of rare gas atoms (Rg?=?Ar, Kr, and Xe) with small neutral and cationic silver clusters have been investigated by density functional methods and the effect of these weak interactions on the resonance Raman spectra of the complexes has been evaluated. The resonance Raman technique that depends on the properties of ground and excited state, seems deeply sensitive to the weak rare gas?metal cluster interactions, and the use of inert gases has been proven to be an excellent approach to recognize the ability of this technique to detect extremely weak interactions. In this work, for , and complexes the IR, normal and resonance Raman spectra have been calculated and the effect of rare gas?cluster stretching vibration ( ) on the pattern and the relative intensities of different spectra have been investigated. The resonance Raman spectra for the weakly interacted complexes (with the interaction energies less than ?2.0 kcal/mol) exhibit the vibration with the detectable intensity that its intensity increases by going from Ag6?Ar to Ag6?Xe complex. Moreover, the resonance Raman spectra (based on the excited state gradient approximation) for high intensity nearly degenerate excited states, proved the effect of accumulation of the excited state charge density on the relative intensity of vibration.","10.1002/qua.25389","Theoretical investigation of the weak interactions of rare gas atoms with silver clusters by resonance Raman spectroscopy modeling","https://doi.org/https://doi.org/10.1002/qua.25389",H.a(["Yasrebi, Sara","Jamshidi, Zahra"],b2),"2017/08/05",H.a([],b2),b5[6],H.a(["excited-state gradient approximation","metal cluster","resonance Raman","weak interaction"],b2),b),Z.b1("The goal of this study is to shed light on the charge-transfer (CT) mechanism of surface-enhanced Raman scattering (SERS) by considering the properties of CT excited states. The calculations have been done by means of an excited-state gradient approximation for a pyridine molecule interacting with a silver cluster, and provided a satisfactory improvement in comparison to previous work. The effect of electrode potential on the SERS-CT spectra has been modelled theoretically by applying an external electric field for selected CT transitions and the enhancement of the [Nu]6a and [Nu]9a modes and a decline in the intensity of the [Nu]8a mode under a negative electric field (which is directed toward the cluster) have been observed. These results match well with the experimental studies and also explain the effect of electrode potentials on the patterns of spectra, as experimental evidence of the CT mechanism. Finally, this study demonstrated that the excited state vector gradient can be used as a distinguishing factor to explain the SERS selection rules.","10.1039/C6CP07585A","Elucidation of charge-transfer SERS selection rules by considering the excited state properties and the role of electrode potential","https://doi.org/10.1039/C6CP07585A",H.a([],b2),"2017",H.a([],b2),b5[2],H.a([],b2),b),Z.b1("The intrinsic challenge in the elucidation of charge-transfer surface-enhanced Raman scattering (SERS) has inspired the present study. It is believed that changing the surface may serve as illustrative evidence for studying the influence of the chemical nature and electronic structure of the substrate on the resonance and nonresonance chemical mechanism of SERS. With the aim of investigating the important parameters which are effective on the ground- and excited-state properties, in this work we have focused on changing the composition of the substrate. Therefore, 6- and 20-atom pure as well as bimetallic silver and gold clusters have been used as models, and the adsorption of pyridine on these clusters has been studied. It has been found that through the nonresonant chemical mechanism, the Au adsorption site becomes favorable. Therefore, the static chemical enhancement of the Au binding site is more than that of Ag, and it is related to the greater binding energy of gold. To determine the effect of the surface on the resonance chemical mechanism, we have calculated the relative intensity of the pyridine-metal cluster on the charge-transfer (CT) resonance condition. The relative intensities of simulated spectra match well with the available experimental results and suggest that changing the surface, which reveals the trend by applying negative potential on a given surface, could be explained by variation of the effective charge of the cluster. These calculations also show the importance of variation of the excited-state vector gradient and dimensionless displacement for different surfaces and their effects on the selection rules. An illuminating insight about the absolute SERS-CT intensity has been provided that shows the higher average scattering cross sections in the order of 105 for binding through Ag in comparison to 103 for binding through Au. In addition, the enhancement factor for the silver binding site has been obtained as 104 in comparison to that of gold, which is 102. This factor is the intermediate value of 103 for alloys, which confirms the idea that alloying improves the enhancement factor of gold.","10.1021/acs.jpcc.6b12069","Effect of Chemical Nature of the Surface on the Mechanism and Selection Rules of Charge-Transfer Surface-Enhanced Raman Scattering","https://doi.org/10.1021/acs.jpcc.6b12069",H.a([g,"Jamshidi, Zahra"],b2),"2017/02/09",H.a(["jp-2016-12069h_0005-9210c359-533a-444e-ab40-69d1d6909330.gif"],b2),b5[8],H.a([],b2),b),Z.b1("The S---P interactions in the complexes of HSX (X = F, Cl, Br, I) with PHnMe3-n(n = 0-3) have been investigated with ab initio calculations at the MP2/aug-cc-pVDZ and MP2/aug-cc-pVTZ//MP2/aug-cc-pVDZ level of theory. The interaction energies and structural properties of intermolecular complexes have been analyzed. Results of QTAIM analysis are dealing with expand of interactions, including pure closed-shell interactions (van der Waals interactions and chalcogen bonding, YB), partially covalent closed-shell (CS; Charge Transfer) and shared-shell interactions (SS; weak covalent bond and very strong YB) for these complexes. The energy decomposition analysis (EDA) showed that electrostatic interactions are an important contributing factor for these complexes. In considering second-order contributions, the donor-acceptor pair charge transfer (CT) is most important. These findings are consistent with the Electron Localization Function (ELF) isosurface of the complexes. In each series of HXS:PHnMe3-n-chalcogen bond complexes with increasing basicity of phosphines, the stability and S---P bond strength of adducts were increased so that the HXS:PMe3 (X = F, Cl, Br) complexes had very strong S---P chalcogen interactions with nearly covalent characters.","10.1080/17415993.2016.1275634","The S---P noncovalent interaction: diverse chalcogen bonds","https://doi.org/10.1080/17415993.2016.1275634",H.a(["Zabardasti, Abedin","Afrouzi, Hossein",a,"Jamshidi, Zahra"],b2),"2017/01/18",H.a(["ESP-X-F-Cl-Br-I-computed-at-the-MP2-aug-cc-pVDZ-theory-level-874fc4b2-4dad-44ae-b153-8ef0a9bfe9ea.jpg","Schematic-representation-of-HSXPhosphines-YB-complexes_W640-f31fc680-5c43-4ca6-9aeb-4882f538579f.jpg","Selected-QTAIM-parameters-in-au-for-HXSPH-n-Me-3-n-YB-comple-a3f4be59-be77-4142-b489-316d0e3d9a10.jpg","Relationship-between-SP-distance-A-and-the-V-c-G-c-parameter-6e1769bc-9bff-470c-b68c-c80e185c8296.jpg","Relationship-between-2-r-BCP-and-SP-internuclear-distances-i-07295bdc-9e91-4caa-8354-4d548dc3c27c.jpg","ELF-map-of-PH-n-Me-3-n-n-1-3-monomers-and-HXSPH-n-Me-3-n-com-f989918a-4dba-4d30-9254-73c4f3c169f9.jpg","figure-fig7_W640-8fda4b6b-db31-45d1-95d5-d01eb9a94bb6.jpg"],b2),b5[9],H.a([],b2),b),Z.b1("","10.1063/1.4948813","Comparative assessment of density functional methods for evaluating essential parameters to simulate SERS spectra within the excited state energy gradient approximation","https://doi.org/10.1063/1.4948813",H.a(["Mohammadpour,Mozhdeh ","Jamshidi,Zahra "],b2),"2016/05/16",H.a([],b2),b5[10],H.a([],b2),2016),Z.b1("Abstract The adsorption of six electron donor?acceptor (D/A) organic molecules on various sizes of graphene nanoflakes (GNFs) containing two common defects, double-vacancy (5-8-5) and Stone?Wales (55-77), are investigated by means of ab?initio DFT [M06-2X(-D3)/cc-pVDZ]. Different D/A molecules adsorb on a defect graphene (DG) surface with binding energies (?Eb) of about ?12 to ?28?kcal?mol?1. The ?Eb values for adsorption of molecules on the Stone?Wales GNF surface are higher than those on the double vacancy GNF surface. Moreover, binding energies increase by about 10?% with an increase in surface size. The nature of cooperative weak interactions is analyzed based on quantum theory of atoms in molecules, noncovalent interactions plot, and natural bond order analyses, and the dominant interaction is compared for different molecules. Electron density population analysis is used to explain the n- and p-type character of defect graphene nanoflakes (DGNFs) and also the change in electronic properties and reactivity parameters of DGNFs upon adsorption of different molecules and with increasing DGNF size. Results indicate that the HOMO?LUMO energy gap (Eg) of DGNFs decreases upon adsorption of molecules. However, by increasing the size of DGNFs, the Eg and chemical hardness of all complexes decrease and the electrophilicity index increases. Furthermore, the values of the chemical potential of acceptor?DGNF complexes decrease with increasing size, whereas those of donor?DGNF complexes increase.","10.1002/cphc.201600614","Surface Charge-Transfer Doping of Graphene Nanoflakes Containing Double-Vacancy (5-8-5) and Stone-Wales (55-77) Defects through Molecular Adsorption","https://doi.org/10.1002/cphc.201600614",H.a([a0,"Jamshidi, Zahra","Kamath, Ganesh"],b2),"2016/10/18",H.a([],b2),b5[11],H.a(["defects","donor-acceptor systems","graphene","noncovalent interactions","surface analysis"],b2),2016),Z.b1("Cationic iron clusters, produced through laser ablation and subsequently complexed with a water molecule Fen+-H2O (n = 6-15) are mass-selectively investigated via infrared multiple photon dissociation (IR-MPD) spectroscopy in the 300-1700 cm-1 spectral range. The experimental data are complemented by density functional theory calculations at the OPBE/TZP level for the Fe13+-H2O system. The observed spectra can be explained by a mixture of clusters where for a majority water is adsorbed molecularly but for a small but significant fraction also dissociation of water molecules occurs. The bands observed at frequencies 300-700 cm-1 exhibit regular, size-dependent frequency shifts, showing that (a) dissociation takes places on all cluster sizes and (b) the interaction of water with the cluster surface is not influenced much by the particular cluster structure. The intensity evolution of the absorption bands suggests that dissociation is increasingly probable for larger cluster sizes.","10.1021/acs.jpclett.6b00891","Water Dissociation upon Adsorption onto Free Iron Clusters Is Size Dependent","https://doi.org/10.1021/acs.jpclett.6b00891",H.a(["Kiawi, Denis M.","Chernyy, Valeriy","Oomens, Jos",a1,"Jamshidi, Zahra","Visscher, Lucas",a2,c],b2),"2016/07/07",H.a(["jz-2016-00891d_0006-55a681e3-1942-4898-ad7e-269b22324aa7.gif"],b2),b5[5],H.a([],b2),2016),Z.b1("Cationic cobalt clusters complexed with water Con+-H2O (n = 6-20) are produced through laser ablation and investigated via infrared multiple photon dissociation (IR-MPD) spectroscopy in the 200-1700 cm-1 spectral range. All spectra exhibit a resonance close to the 1595 cm-1 frequency of the free water bending vibration, indicating that the water molecule remains intact upon adsorption. For n = 6, the frequency of this band is blue-shifted, but it gradually converges to the free water value with increasing cluster size. In the lower-frequency range (200-650 cm-1) the spectra contain several bands which show a very regular frequency evolution, suggesting that the exact cluster geometry has little effect on the water-surface interaction. Density functional theory (DFT) calculations are carried out at the OPBE/TZP level for three representative sizes (n = 6, 9, 13) and indicate that the vibrations responsible for the resonances correspond to bending and torsional modes between the cluster and water moieties. The potential energy surfaces describing these interactions are very shallow, making the calculated harmonic frequencies and IR intensities very sensitive to small geometrical perturbations. We conclude that harmonic frequency calculations on (local) minima structures provide insufficient information for these types of cluster complexes and need to be complemented with calculations that provide a more extensive sampling of the potential energy surface.","10.1021/acs.jpca.5b07119","Water Adsorption on Free Cobalt Cluster Cations","https://doi.org/10.1021/acs.jpca.5b07119",H.a(["Kiawi, Denis M.",c,"Oomens, Jos",a1,"Jamshidi, Zahra","Visscher, Lucas",a2],b2),"2015/11/05",H.a(["jp-2015-071198_0010-116e71d3-f7f0-4635-93e1-a16804c8c1f6.gif"],b2),b5[13],H.a([],b2),a3),Z.b1("The effects of the weak interactions of rare gas atoms on the UV-visible absorption spectra of gold dimer and tetramer clusters are investigated. The time-dependent density functional theory based on the two-component relativistic zeroth-order regular approximation that considered spin-orbit coupling is performed to estimate the absorption spectra of Au2,4-Rgn (Rg = Ne-Xe, and n = 1-6) complexes. Using spin-orbit, including the appropriate functional, shows a close correlation between experiment and our calculations. It is also demonstrated that the weak interactions between rare gas atoms and gold clusters affect the UV-vis spectra of Au2,4 clusters by shifting the electronic transition toward the blue. Moreover, we find that the order of change in peak position, [CapitalDelta][Nu]\u0303, is proportional to the strength of interactions: [CapitalDelta][Nu]\u0303Au2,4-Xe > [CapitalDelta][Nu]\u0303Au2,4-Kr > [CapitalDelta][Nu]\u0303Au2,4-Ar > [CapitalDelta][Nu]\u0303Au2,4-Ne. In addition, comparing the UV-visible spectra of Au2,4-Rgn complexes with those of isolated Au2 and Au4 clusters shows that for Au2,4-Rg2,4,6 complexes in which Rg atoms interacted symmetrically with gold clusters no additional peaks are observed compared to isolated clusters; however, for Au2,4-Rg1,3,5 complexes, extra peaks appear because of the decrease in symmetry.","10.1021/acs.jpca.5b03151","Investigation of the Electronic Excited States of Small Gold Clusters in Rare Gas Matrices: Spin-Orbit Time-Dependent Density Functional Theory Calculation","https://doi.org/10.1021/acs.jpca.5b03151",H.a(["Jamshidi, Zahra","Kaveei, Elham",g],b2),"2015/08/13",H.a(["jp-2015-03151b_0003-cd7f2007-e492-40ca-ae19-967c7453f5ab.gif"],b2),b5[13],H.a([],b2),a3),Z.b1("In this study, two types of ionic liquids (ILs) based on 1-butyl-3-methylimidazolium [Bmim]+ and butyltrimethylammonium [Btma]+ cations, paired to tetrafluoroborate [BF4]-, hexafluorophosphate [PF6]-, dicyanamide [DCA]-, and bis(trifluoromethylsilfonyl)imide [Tf2N]- anions, were chosen as adsorbates to investigate the influence of cation and anion type on the adsorption of ILs on the graphene surface. The adsorption process on the graphene surface (circumcoronene) was studied using M06-2X/cc-pVDZ level of theory. Empirical dispersion correction (D3) was also added to the M06-2X functional to investigate the effects of dispersion on the binding energy values. The graphene---IL configurations, binding energies, and thermochemistry of IL adsorption on the graphene surface were investigated. Orbital energies, charge transfer behavior, the influence of adsorption on the hydrogen bond strength between cation and anion of ILs, and the significance of noncovalent interactions on the adsorption of ILs on the graphene surface were also considered. ChelpG analysis indicated that upon adsorption of ILs on the graphene surface the overall charge on the cation, anion, and graphene surface changes, enabled by the charge transfer that occurs between ILs and graphene surface. Orbital energy and density of states calculations also show that the HOMO-LUMO energy gap of ILs decreases upon adsorption on the graphene surface. Quantum theory of atoms in molecules analysis indicates that the hydrogen-bond strength between cation and anion in ILs decreases upon adsorption on the graphene surface. Plotting the noncovalent interactions between ILs and graphene surface shows the role and significance of cooperative [Pi]---[Pi], C-H---[Pi], and X---[Pi] (X = N, O, F atoms from anions) interactions in the adsorption of ILs on the graphene surface. The thermochemical analysis also indicates that the free energy of adsorption ([CapitalDelta]Gads) of ILs on the graphene surface is negative, and thus the adsorption occurs spontaneously.","10.1021/jp512020q","Meta-Hybrid Density Functional Theory Study of Adsorption of Imidazolium- and Ammonium-Based Ionic Liquids on Graphene Sheet","https://doi.org/10.1021/jp512020q",H.a([a0,"Jamshidi, Zahra","Bayat, Ahmad","Kamath, Ganesh"],b2),"2015/04/02",H.a(["jp-2014-12020q_0006-b61f9590-9829-4ec8-a3ed-373bbd84f5f2.gif"],b2),b5[8],H.a([],b2),a3),Z.b1("Nanoparticles (NPs) are increasingly being used in different branches of science and in industrial applications; however, their rapid detection and characterization at low concentration levels have remained a challenge; more specifically, there is no single technique that can characterize the physicochemical properties of NPs (e.g. composition and size). In this work we have developed a colorimetric sensor array for defining the physicochemical properties of NPs in aqueous solution with ultra-low concentrations (e.g. 10-7g ml-1 for gold NPs). Various NPs were readily identified using a standard chemometric approach (i.e. hierarchical clustering analysis), with no misclassifications over 400 trials.","10.1039/C4NR00580E","Determination of nanoparticles using UV-Vis spectra","https://doi.org/10.1039/C4NR00580E",H.a([],b2),"2015",H.a([],b2),b5[16],H.a([],b2),a3),Z.b1("The interactions of gold atom and clusters (Au2 and Au3) with the active sites of graphyne (GY) have been investigated using density functional theory (PBE, PBE-D3, and B3LYP-D3). In order to compare performance of DFT functional (BP86, PBE, TPSSh, B3LYP, PBE-D3, TPSSh-D3, and B3LYP-D3), the interactions of Au2 with various functional groups such as sp, sp2 and aromatic sp2 carbon atoms, sp,sp2 and aromatic sp2-bonds have been investigated and also compared with the ab initio MP2 results. Additionally, the nature of interactions for graphyne[Dash]Au2 complexes are interpreted by means of the natural bond orbital (NBO), the quantum theory of atoms in molecules (QTAIM) and energy decomposition analysis (EDA) and compared with those of related graphene[Dash]Au2. This study suggests that graphyne shows complex behavior in comparison to those of graphene and could also be useful in modeling of the next generation electronic devices.","10.1016/j.jmgm.2014.09.004","Interactions of small gold clusters, Aun (n=1-3), with graphyne: Theoretical investigation","https://doi.org/10.1016/j.jmgm.2014.09.004",H.a(["Azizi, Elmira",a4,"Jamshidi, Zahra"],b2),"2014/11/01",H.a(["1-s2.0-S1093326314001582-fx1_lrg-7cd31ce8-7d38-49f1-948f-ced635c4d41c.jpg"],b2),b5[17],H.a(["Graphyne","Gold cluster","Surface sensors","Energy decomposition analysis","Charge transfer"],b2),a5),Z.b1("The adsorption of ionic liquids (ILs) on the hexagonal boron-nitride (h-BN) surface was studied at the M06-2X/cc-pVDZ level of theory. Three types of ionic liquids based on 1-butyl-3-methylimidazolium [Bmim]+, 1-butylpyridinium [Bpy]+, and butyltrimethylammonium [Btma]+ cations, paired with tetrafluoroborate [BF4]-, hexafluorophosphate [PF6]-, and bis(trifluoromethylsilfonyl)imide [Tf2N]- anions were chosen as the adsorbates to better understand the trends in adsorption behavior of ILs on the h-BN surface. We have identified the various stable configurations of the h-BN-ionic liquid (h-BN---IL) complexes based on their binding energies and investigated the effect of charge transfer behavior and noncovalent interactions on the adsorption of ILs. ChelpG analysis indicated that, upon adsorption of ionic liquids on the h-BN surface, the overall charge on the cation, anion, and h-BN surface changes and the transfer (CT) between ILs and h-BN surface occurs. The order for the magnitude of charge transfer between different ILs and the h-BN surface is as follows: [Bmim][Tf2N] (-0.059e) > [Btma][PF6] (0.036e) > [Bpy][Tf2N] (0.028e) > [Btma][Tf2N] (0.021e) > [Bmim][PF6] (0.009e) > [Bpy][BF4] (0.007e) > [Bpy][PF6] (-0.006e) > [Btma][BF4] (-0.003e) > [Bmim][BF4] (-0.001e), respectively. Orbital energy and density of states (DOSs) calculations also show that the HOMO-LUMO energy gap of ILs decreases upon adsorption on the h-BN surface. The order of the HOMO-LUMO gap energy changes of ILs upon adsorption on the h-BN surface is as follows: [Btma][PF6] (3.25 eV) > [Btma][BF4] (2.84 eV) > [Bpy][PF6] (2.41 eV) > [Bpy][BF4] (2.29 eV) > [Bmim][BF4] (1.76 eV) > [Bmim][PF6] (1.54 eV) > [Btma][Tf2N] (1.26 eV) > [Bmim][Tf2N] (1.19 eV) > [Bpy][Tf2N] (0.86 eV), respectively. The binding energies based on QTAIM analysis indicate that the [BF4]-, [PF6]-, and [Tf2N]- anions in the ILs have a stronger interaction with the h-BN surface than [Bmim]+, [Bpy]+, and [Btma]+ cations. The role of cooperative [Pi]---[Pi], C-H---[Pi], and X---[Pi] (X = N, O, F atoms from anions) interactions on the adsorption of ILs on the h-BN surface was elucidated by analyzing the noncovalent interactions between ILs and the h-BN surface. Energy decomposition analysis (EDA) carried out for the h-BN---IL complexes indicates that the contribution of the [CapitalDelta]Edisp component in each complex is also more than electrostatic ([CapitalDelta]Eelect) and orbital ([CapitalDelta]Eorb) components ([CapitalDelta]Edisp > [CapitalDelta]Eelect\xa0> [CapitalDelta]Eorb), with the exception of the h-BN[Btma][BF4] complex whose [CapitalDelta]Edisp and [CapitalDelta]Eelect components are almost equal. For the complexes with the same cations, dispersion interaction increases by increasing size of anion from [BF4]- to [PF6]- and [Tf2N]-. This is confirmed by more favorable enthalpy of adsorption for ILs on the h-BN surface. The thermochemical analysis also indicates that the free energy of adsorption ([CapitalDelta]Gads) of ILs on the h-BN surface is negative, and thus, the adsorption occurs spontaneously. Our first-principles study offers fundamental insights into the nature of the physisorption and solvation behavior of ionic liquids on h-BN.","10.1021/jp506277n","Trends in Physisorption of Ionic Liquids on Boron-Nitride Sheets","https://doi.org/10.1021/jp506277n",H.a([a0,"Kamath, Ganesh","Jamshidi, Zahra"],b2),"2014/11/13",H.a(["jp-2014-06277n_0008-3a6f4bc1-83ad-4a3a-8acc-f05267c87488.gif"],b2),b5[8],H.a([],b2),a5),Z.b1(a6,"10.1063/1.4897540","Potential energy curves for the ground and low-lying excited states of CuAg","https://doi.org/10.1063/1.4897540",H.a(["Alizadeh,Davood ","Jamshidi,Zahra ","Shayesteh,Alireza "],b2),"2014/10/15",H.a([],b2),b5[19],H.a([],b2),a5),Z.b1("To investigate the factors influencing the luminescent properties of polymetallic cycloplatinated complexes a detailed study of the photophysical and structural properties of the heteronuclear complexes [Pt2Me2(bhq)2([Mu]-dppy)2Ag2([Mu]-acetone)](BF4)2, 2, [PtMe(bhq)(dppy)Tl]PF6, 3, and [Pt2Me2(bhq)2(dppy)2Tl]PF6, 4, [bhq = benzo[h]quinoline, dppy = 2-(diphenylphosphino)pyridine] was conducted. Complexes 3 and 4 synthesized by the reaction of [PtMe(bhq)(dppy)], 1, with TlPF6 (1 or 1/2 equiv.) and stabilized by unsupported Pt-Tl bonds as revealed by multinuclear NMR spectroscopy and confirmed by X-ray crystallography for 3. DFT calculations for the previously reported butterfly Pt2Ag2 cluster 2 reveal that in the optimized geometry the bridging acetone molecule is removed and the metal core displays a planar-shaped geometry in which according to a QTAIM calculation and natural bond orbital (NBO) analysis the Ag.Ag metallophilic interaction is strengthened. In contrast to the precursor 1, which is only emissive in glassy solutions (3MLCT 485 nm), all 2-4 heteropolynuclear complexes display intense emissions in the solid state and in glassy solutions. Time-dependent density functional theory (TD-DFT) is used to elucidate the origin of the electronic transitions in the heteronuclear complexes 2 and 3. The low energy absorption and intense orange emission for cluster 2 (solid 77 K and glass) are attributed to metal-metal to ligand charge transfer (MM`LCT) with a minor L`LCT contribution. For 3 and 4 two different bands are developed: the high energy band (602-630 nm) observed for 4 at 77 K (solid, glass) and in diluted glasses for 3 is ascribed to emission from discrete Pt2Tl units of mixed 3L`LCT/3LM`CT origin. However, the low energy band (670-690 nm) observed at room temperature (solid) for both complexes and also in concentrated glasses for 3 is assigned to 3[Pi][Pi] excited states arising from intermolecular interactions.","10.1039/C3DT52209A","Cyclometalated heteronuclear Pt/Ag and Pt/Tl complexes: a structural and photophysical study","https://doi.org/10.1039/C3DT52209A",H.a([],b2),"2014",H.a([],b2),b5[20],H.a([],b2),a5),Z.b1('The nature of the anion-[Pi] interaction has been investigated by carrying out ab initio calculations of the complexes of coinage metal anions (Au-, Ag-, and Cu-) with different kinds of [Pi]-systems. The binding energies indicate that gold anion has the highest and copper anion has the lowest affinity for interactions with [Pi]-systems. Different aspects of the anion-[Pi] interaction in these systems have been investigated, including charge-transfer effects (using the Merz-Kollman method), "atoms-in-molecules" (AIM) topological parameters, and interaction energies (using energy decomposition analysis, EDA). Our results indicated that, for most M----[Pi] interactions, the electrostatic term provides the dominant contribution, whereas polarization, charge transfer, and dispersion effects contribute less than 25\xa0% of the interaction. We believe that the present results should lead to a greater understanding of the basis for anion-[Pi] interactions of coinage metal anions.',"10.1007/s00894-013-1965-y","Do coinage metal anions interact with substituted benzene derivatives?","https://doi.org/10.1007/s00894-013-1965-y",H.a([a7,"Jamshidi, Zahra","Farhangian, Hossein"],b2),"2013/11/01",H.a([],b2),b5[21],H.a([],b2),a8),Z.b1("In this study, ionic liquids formed between 1-ethyl-3-methylimidazolium cation ([emim]+) and alkyl-trifluoroborate ([RBF3]-, R=n-CmH2m+1 (m=1-5)) anions have been investigated theoretically. The interactions between the cation and anions have also been calculated at the MP2/6-311++G(d,p)//B3LYP/6-311++G(d,p) level of theory. The calculated interaction energies were found to decrease in magnitude with the increase of side-chain length in anions. The results of energy decomposition analysis (EDA) show that the interaction of these anions with [emim]+ cation is electrostatic in the nature and the side chain length in the anions has an important effect on the contribution of [CapitalDelta]Eelect term. The H-bonds in the most stable ion pairs occur between fluorine atoms of anion and hydrogen atoms of methyl, ethyl groups and the hydrogen atom on the imidazolium ring (C2H). These H-bonds were also considered by quantum theory of atoms in molecules (QTAIM).","10.1016/j.jfluchem.2013.05.009","Structural and electronic properties of alkyl-trifluoroborate based ionic liquids: A theoretical study","https://www.sciencedirect.com/science/article/pii/S0022113913001887",H.a([a0,"Jamshidi, Zahra","Bayat, Ahmad",a9],b2),"2013/09/01/",H.a([],b2),b5[22],H.a(["Ionic liquids","Cation-anion interaction","Alkyl-trifluoroborate","QTAIM analysis","NBO analysis"],b2),a8),Z.b1("The preparation of an unsupported tetranuclear cluster with a linear Pt0-TlI-TlI-Pt0 metal chain is described. The complex shows strong red emission in the solid state, having a quantum yield of 73%. Density functional theory (DFT) and time-dependent DFT calculations show that red emission originated from a platinum to thallium-thallium charge-transfer excited state.","10.1021/ic401890t","A Highly Efficient Luminescent Pt2Tl2 Chain with a Short TlI-TlI Interaction","https://doi.org/10.1021/ic401890t",H.a(["Jamali, Sirous","Ashtiani, Mona M.","Jamshidi, Zahra","Lalinde, Elena",k,"Samouei, Hamidreza","Escudero-Ad\xe1n, Eduardo","Benet-Buchholz, Jordi"],b2),"2013/10/07",H.a(["ic-2013-01890t_0005-ad53c8a6-c5b5-4ef4-a65e-515007604bbe.gif"],b2),b5[23],H.a([],b2),a8),Z.b1(a6,"10.1002/qua.24427","Nature of closed- and open-shell interactions between noble metals and rare gas atoms","https://doi.org/10.1002/qua.24427",H.a(["Jamshidi, Zahra","Eskandari, Kiomars","Azami, S. Mohammad"],b2),"2013/08/15",H.a([],b2),b5[24],H.a(["closed-shell interaction","energy decomposition analysis","CAM-B3LYP","gold"],b2),a8),Z.b1("Abstract Interactions of [Alpha]-D-glucose with gold, silver, and copper metal clusters are studied theoretically at the density functional theory (CAM-B3LYP) and MP2 levels of theory, using trimer clusters as simple catalytic models for metal particles as well as investigating the effect of cluster charge by studying the interactions of cationic and anionic gold clusters with glucose. The bonding between [Alpha]-D-glucose and metal clusters occurs by two major bonding factors; the anchoring of M atoms (M = Cu, Ag, and Au) to the O atoms, and the unconventional M?H?O hydrogen bond. Depending on the charge of metal clusters, each of these bonds contributes significantly to the complexation. Binding energy calculations indicate that the silver cluster has the lowest and gold cluster has the highest affinity to interact with glucose. Natural bond orbital analysis is performed to calculate natural population analysis and charge transfers in the complexes. Quantum theory of atoms in molecules was also applied to interpret the nature of bonds. ? 2012 Wiley Periodicals, Inc.","10.1002/qua.24122","Glucose interaction with Au, Ag, and Cu clusters: Theoretical investigation","https://doi.org/10.1002/qua.24122",H.a(["Jamshidi, Zahra","Farhangian, Hossien",a4],b2),"2013/04/15",H.a([],b2),b5[24],H.a(["glucose","metal clusters","biosensor","density functional theory"],b2),a8),Z.b1("The molecular interactions between sulfur ylide (SY) and HX molecules (X\xa0=\xa0F, CN, and N3) were investigated using the MP2 method at 6-311++G(2d,2p) basis set. Three different patterns including non-classical hydrogen bond (HB) H---C and classical HB H---X were found for complex formation between SY and HX molecules. Stability of the H---C type complexes are greater than H---X complexes. Quantum theories of atoms in molecules, natural bond orbitals, and energy decomposition analysis methods have been applied to analyze the intermolecular interactions. Good correlations have been found between the interaction energies (SE), the second-order perturbation energy E(2) and the charge transfer qCT in the studied systems.","10.1007/s11224-012-0072-5","Theoretical study of molecular interactions of sulfur ylide with HF, HCN, and HN3","https://doi.org/10.1007/s11224-012-0072-5",H.a(["Zabaradsti, Abedien",a,"Ghasemian, Motaleb","Jamshidi, Zahra"],b2),"2013/02/01",H.a(["11224_2012_72_Fig1_HTML-40e7c6de-a330-4642-ae91-58f82690c447.gif","11224_2012_72_Sch1_HTML-2266ff3e-3f10-47ee-9a7b-f3fc30f0d7b7.gif","11224_2012_72_Sch2_HTML-4793919e-bcc9-4545-90e3-ae8d7ce9cb29.gif","11224_2012_72_Sch3_HTML-97536cd6-8b7d-4dee-acef-ca4e82332058.gif","11224_2012_72_Fig2_HTML-e5c972a9-2db1-4c69-a6c4-29247bea3a6c.gif"],b2),b5[26],H.a([],b2),a8),Z.b1("The spin-free and spin-orbit potential energy curves of ground and excited states of AgAu up to 5 eV have been investigated. Calculations have been performed at the all-electron level with scalar relativistic effects included through the second-order Douglas-Kroll-Hess Hamiltonian. We have used the complete active space multi-configuration self-consistent field method, followed by the multi-reference configuration interaction (MRCI) calculations. Energetics and spectroscopic constants have been reported for all states. Our data show excellent agreement with the experimental measurements. Time dependent density functional theory calculations using the LDA, BLYP, B3LYP, and SAOP functionals have been carried out for AgAu and the accuracy of TD-DFT has been compared with ab initio results.","10.1039/C3CP52647J","Spin-orbit and relativistic all-electron potential energy curves for the ground and low-lying excited states of AgAu","http://dx.doi.org/10.1039/C3CP52647J",H.a([],b2),"2013",H.a([],b2),b5[2],H.a([],b2),a8),Z.b1("Binding of noble metal clusters (Mn, M = Cu, Ag, and Au; n = 2-4) with rare gas atoms (Rg = Kr, Xe, and Rn) has been investigated at the density functional (CAM-B3LYP) and ab initio (MP2) levels of theory. The calculation shows significant affinity of neutral metal clusters for interaction with rare gas atoms. The binding energies indicate that gold clusters have the highest and silver clusters have the lowest affinity for interaction with rare gas atoms, and for the same metal clusters, there is a continuous increase in Eb from Kr to Rn. The M-Rg bonding mechanism have been interpreted by means of the quantum theory of atoms in molecules (QTAIM), natural bond orbital (NBO), and energy decomposition analysis (EDA). According to these theories, the M-Rg bonds are found to be partially electrostatic and partially covalent. EDA results identify that these bonds have less than 40% covalent character and more than 60% electrostatic, and also NBO calculations predict the amount of charge transfer from the lone pair of rare gas to [Sigma]* and n*orbitals of metal clusters.","10.1021/jp3106474","Binding of Noble Metal Clusters with Rare Gas Atoms: Theoretical Investigation","https://doi.org/10.1021/jp3106474",H.a(["Jamshidi, Zahra","Far, Maryam Fakhraei","Maghari, Ali"],b2),"2012/12/27",H.a(["jp-2012-106474_0006-906b3a72-3ce1-44cb-9fdb-885a55efb7c0.gif"],b2),b5[13],H.a([],b2),b0),Z.b1("The relative stabilities and noncovalent interactions of the six low-lying energy tautomers of cytosine nucleobase with some biological anions (such as F-, Cl-, and CN-) have been investigated in gas phase by density functional theory (DFT) method in conjunction with 6-311++G (d,p) atomic basis set. Furthermore, to systematically investigate all possible tautomerisms from cytosine induced by proton transfer, we describe a study of structural tautomer interconversion in the gas phase and in a continuum solvent using DFT calculation. We carried out geometrical optimizations with the integral equation formalism of polarizable continuum (IEF-PCM) model to account for the solvent effect, and the results were compared with those in the gas phase. The result of calculation revealed that anions bind mostly in a bidentate manner via hydrogen bond, and stabilization energies of these complexes are larger than those in the case when anions bind in a monodentate manner. The quantum theory of atoms in molecules (QTAIM), natural bonding orbital (NBO) and energy decomposition analysis (EDA) have also been applied to understand the nature of hydrogen bond interactions in these complexes. NBO analysis reveals that the interaction patterns between the anions and the tautomers are [Sigma]-type interaction between lone pairs and sigma_N--H  , sigmaO--Hand sigmaH--F antibonding orbitals. Also, according to these theories, the interactions are found to be partially electrostatic and partially covalent. EDA results identify that these bonds have less than 35% covalent character and more than 65% electrostatic, and the covalent character increases in different anions in the order F-\xa0>\xa0CN-\xa0>\xa0Cl-. On the other hand, orbital interaction energies of complexes of F- anion are more than those of Cl- and CN- complexes. The lower orbital interaction energies in complexes of Cl- and CN-anions imply less charge transfer and stronger ionic bond character. Furthermore, relationship between the orbital interaction energy (E2) with hydrogen bonding energy (EH---X) and the electron density ([Rho](r)) with hydrogen bonding energy of F-, Cl- and CN- complexes have also been investigated.","10.1007/s11224-012-9993-2","Can anion interaction accelerate transformation of cytosine tautomers? Detailed view form QTAIM analysis","https://doi.org/10.1007/s11224-012-9993-2",H.a([b1,a4,a9,"Jamshidi, Zahra"],b2),"2012/12/01",H.a(["11224_2012_9993_Fig1_HTML-515bbc13-ee35-4dce-9869-20f660788939.gif","11224_2012_9993_Fig2_HTML-707d14b8-653e-4093-bbf1-16c9de225a28.gif11224_2012_9993_Fig3_HTML-c4e59787-39b0-4ff0-a7ea-4e774f78f988.gif11224_2012_9993_Fig4_HTML-346f7954-89b6-4b7d-8793-9ef2dcf408c1.gif11224_2012_9993_Fig5_HTML-f758d1a7-7eab-45c8-ab09-274c8f3ee8e2.gif11224_2012_9993_Fig6_HTML-bc1fb327-b011-4b9d-a4a0-81477b7b2826.gif"],b2),b5[26],H.a([],b2),b0),Z.b1("Understanding the nature of the interaction between metal nanoparticles and biomolecules has been important in the development and design of sensors. In this paper, structural, electronic, and bonding properties of the neutral and anionic forms of glutathione tripeptide (GSH) complexes with a Au3 cluster were studied using the DFT-B3LYP with 6-31+G**-LANL2DZ mixed basis set. Binding of glutathione with the gold cluster is governed by two different kinds of interactions: Au-X (X = N, O, and S) anchoring bond and Au---H-X nonconventional hydrogen bonding. The influence of the intramolecular hydrogen bonding of glutathione on the interaction of this peptide with the gold cluster has been investigated. To gain insight on the role of intramolecular hydrogen bonding on Au-GSH interaction, we compared interaction energies of Au-GSH complexes with those of cystein and glycine components. Our results demonstrated that, in spite of the ability of cystein to form highly stable metal-sulfide interaction, complexation behavior of glutathione is governed by its intramolecular backbone hydrogen bonding. The quantum theory of atom in molecule (QTAIM) and natural bond orbital analysis (NBO) have also been applied to interpret the nature of interactions in Au-GSH complexes. Finally, conformational flexibility of glutathione during complexation with the Au3 cluster was investigated by means of monitoring Ramachandran angles.","10.1021/jp2080226","Interactions of Glutathione Tripeptide with Gold Cluster: Influence of Intramolecular Hydrogen Bond on Complexation Behavior","https://doi.org/10.1021/jp2080226",H.a([a7,"Jamshidi, Zahra",b1,a9],b2),"2012/05/03",H.a(["jp-2011-080226_0006-0c8a3d5f-11ae-4bfc-8668-4a2e9f7be061.gif"],b2),b5[13],H.a([],b2),b0),Z.b1("Binding of Mg2+, Ca2+, Zn2+, and Cu+ metal ions with 2?-deoxythymidine (dT) nucleoside was studied using a density functional theory method and a 6-311++G(d,p) basis set. This work demonstrated that the interaction of dT with these cations is tri-coordinated ? (O2, O4?, O5?). Among the four types of cations, Zn2+ cation exhibited the most tendency to interact with the dT. Cations via their interaction with dT can affect the N-glycosidic bond length, the values of pseudorotation of the sugar ring, the orientation of the base unit with respect to the sugar ring, and the acidity of the O5?H, O3?H, and N3H groups in the dT nucleoside. Natural bond orbital analysis was performed to calculate the charge transfer and natural population analysis of the complexes. Quantum theory of atoms in molecules was also applied to determine the nature of interactions. It was shown that in dT?Mg2+ and dT?Ca2+ complexes, the bonds are electrostatic (closed-shell) interactions, although they are partially covalent and partially electrostatic interactions in dT?Zn2+ and dT?Cu+ complexes. Copyright ? 2011 John Wiley & Sons, Ltd.","10.1002/poc.1888","Interaction of cations with 2`-deoxythymidine nucleoside and analysis of the nature and strength of cation bonds","https://doi.org/10.1002/poc.1888",H.a([a0,a9,"Jamshidi, Zahra"],b2),"2012/02/01",H.a([],b2),b5[31],H.a(["charge transfer","metal ion affinity","natural bond orbital (NBO)","quantum theory of atoms in molecules (QTAIM)","2`-deoxythymidine (dT)"],b2),b0),Z.b1("Understanding the nature of interaction between metal nanoparticles and biomolecules such as amino acids is important in the development and design of biosensors. In this paper, binding of M3 clusters (M = Au, Ag and Cu) with neutral and anionic forms of histidine amino acid was studied using density functional theory (DFT-B3LYP). It was found that the interaction of histidine with M3 clusters is governed by two major bonding factors: (a) the anchoring N-M and O-M bonds and (b) the nonconventional N-H.M and O-H.M hydrogen bonds. The nature of these chemical bonds has been investigated based on quantum theory of atoms in molecules (QTAIM) and natural bond orbital (NBO) analyses. In the next step, the effects of Au, Ag and Cu metal clusters on the gas-phase acidity of weak organic acid (histidine) have been explored. The acidity of isolated histidine was compared with the acidity of its Au3-, Ag3- and Cu3-complexed species. Results indicate that upon complexation with M3 clusters (at 298 K), the gas-phase acidity (GPA) of histidine varies from 339.5 to 312.3, 315.0, and 313.7 kcal mol-1 for Au3-, Ag3- and Cu3-His complexes, respectively (i.e., its dissociation becomes much less endothermic). These values indicate that a weak organic acid can be converted to a super acid when it is complexed with metal clusters. Also, in order to investigate the acidity value of the imidazole moiety in histidine, histidine methyl ester (His-OMe) was selected. Similarly, the acidity of this compound was compared with the acidity of their Au3, Ag3 and Cu3-complexed species. After complexation with M3 clusters at 298 K, the gas-phase acidity (GPA) of His-OMe varies from 333.0 to 280.0, 304.2 and 291.5 kcal mol-1, respectively. Moreover, pKa values were determined in water for isolated and complexed species of His and His-OMe. The resulting pKa values were found to decrease upon complexation with M3 clusters.","10.1039/C2OB25711D","Interactions of coinage metal clusters with histidine and their effects on histidine acidity; theoretical investigation","http://dx.doi.org/10.1039/C2OB25711D",H.a([],b2),"2012",H.a([],b2),b5[32],H.a([],b2),b0),Z.b1("The binuclear cyclometalated complexes [Pt2Me2(ppy)2([Mu]-dppm)], 1a, and [Pt2Me2(bhq)2([Mu]-dppm)], 1b, in which ppy = 2-phenylpyridyl, bhq = benzo{h}quinoline and dppm = bis(diphenylphosphino)methane, were synthesized by the reaction of [PtMe(SMe2)(ppy)] or [PtMe(SMe2)(bhq)] with 1/2 equiv of dppm at room temperature, respectively. Complexes 1a and 1b were fully characterized by multinuclear (1H, 31P, 13C, and 195Pt) NMR spectroscopy and were further identified by single crystal X-ray structure determination. A comparison of the intramolecular Pt-Pt and [Pi]-[Pi] interactions in complexes 1a and 1b has been made on the basis of data on crystal structures and wave functions analysis. The binuclear complexes 1a and 1b are luminescent in the solid state, and showing relatively intense orange-red emissions stemming from 3MMLCT excited states. The reaction of complex 1b with excess MeI gave the binuclear cyclometalated Pt(iv)-Pt(iv) complex [Pt2Me4(bhq)2([Mu]-I)2], 2. Crystal structure of complex 2 shows intermolecular C-H.I and C-H.[Pi] interactions in solid state.","10.1039/C1DT10834D","Synthesis, structure and photophysical properties of binuclear methylplatinum complexes containing cyclometalating 2-phenylpyridine or benzo{h}quinoline ligands: a comparison of intramolecular Pt-Pt and [Pi]-[Pi] interactions","http://dx.doi.org/10.1039/C1DT10834D",H.a([],b2),"2011",H.a([],b2),b5[20],H.a([],b2),2011),Z.b1("The interactions of pure (Auk, Agk, and Cuk; k = 1-3) and binary alloy (AunAgm and AunCum; m + n = k <= 3) metal clusters with hydrogen sulfide (H2S) have been investigated by using density functional theory (BP86, B3LYP, and CAM-B3LYP) and ab initio methods (MP2 and CCSD(T)), with a focus on the nature of metal-sulfur bonds. Binding energy calculations indicate that for pure metal clusters, the tendency of metal to interact with H2S has the order of Au > Cu > Ag. In binary alloy clusters, alloying Auk with copper and silver decreases the attraction of Au toward H2S, while alloying Agk and Cuk by gold increases the attraction of Ag and Cu toward H2S, significantly. Dissociation energy values for isolated metal clusters specify the more favorable formation of binary alloy clusters (AunAgm and AunCum) over pure ones. The nature of M-S bonds (M = Au, Ag, and Cu) is also interpreted by means of the quantum theory of atoms in molecules (QTAIM), natural bond orbital (NBO), and energy decomposition analysis (EDA). According to these theories, the M-S bonds are found to be partially electrostatic and partially covalent. EDA results identify that these bonds have less than 35% covalent character and more than 65% electrostatic, and the covalent character increases in different metals in the order Au > Cu > Ag.","10.1021/jp100423b","Nature and Strength of M-S Bonds (M = Au, Ag, and Cu) in Binary Alloy Gold Clusters","https://doi.org/10.1021/jp100423b",H.a(["Pakiari, A. H.","Jamshidi, Z."],b2),"2010/09/02",H.a(["jp-2010-00423b_0005-76e70054-4103-4abc-a616-b3b57d903e00.gif"],b2),b5[13],H.a([],b2),2010),Z.b1("The interaction of chalcogen dihydrides (H2E; E = O, S, and Se) with small coinage metal clusters (Mn; M = Cu, Ag, and Au, n = 3 and 4) is studied based on density functional theory, with a focus on the nature of chalcogen-metal bonds. A newly developed pseudopotential-based correlation-consistent basis set is used for metal clusters together with the 6-311++G** basis set for the remaining atoms. Geometrical data identified that no significant deviation has been observed for molecules before and after complexation. For these three metals, binding energy calculations indicate that gold has the highest and silver has the lowest affinities for interaction with H2E. In comparison with gold and copper, complexation between silver and chalcogen dihydrides is significantly weaker. It is found that interaction of H2E molecules with the coinage metals have the order of H2Se > H2S > H2O. Therefore, in agreement with experimental works, our calculations confirm that the gold-selenium bond is the most stable. The nature of M-E bonds is also interpreted by means of the quantum theory of atoms in molecules (QTAIM) and natural bond orbital (NBO) analyses. According to the QTAIM results, the bonds are found to be partially ionic and partially covalent. Natural resonance theory (NRT) is used to calculate natural bond order and bond polarity. The NRT result indicates that the percentage of polarity of M-E bonds is affected by coinage metals.","10.1021/jp804033w","Interaction of Coinage Metal Clusters with Chalcogen Dihydrides","https://doi.org/10.1021/jp804033w",H.a(["Pakiari, A.H.","Jamshidi, Z."],b2),"2008/08/01",H.a([],b2),b5[13],H.a([],b2),2008),Z.b1("Abstract We carried out computational studies of OPX3 and SPX3 (X = Br and I) molecules and their corresponding anions using density functional theory, M?ller-Plesset, and CCSD(T) methods with newly developed model core potentials (MCP). Reliabilities of the MCP were demonstrated by comparing experimental and calculated results. We computed the geometric structure, electron affinities, and electrostatic moments using systematic sequences of the dzp-, tzp-, and qzp-quality basis sets. Both C3v and Cs symmetries were assumed to ascertain that minima on the potential energy surface were found. Infrared and Raman frequencies were calculated and compared with available experimental data. Natural population analyses were performed and used to determine distribution of the extra electron in anions. ? 2007 Wiley Periodicals, Inc. J Comput Chem, 2007","10.1002/jcc.20726","Electron affinities of heavier phosphoryl and thiophosphoryl halides APX3 (A = O, S and X = Br, I)","https://doi.org/10.1002/jcc.20726",H.a(["Zeng, T.","Jamshidi, Z.","Mori, H.","Miyoshi, E.","Klobukowski, M."],b2),"2007/09/01",H.a([],b2),b5[36],H.a(["(thio-) phosphoryl halide","electron affinity","model core potential"],b2),2007),Z.b1("Binding of gold and silver clusters with amino acids (glycine and cysteine) was studied using density functional theory (DFT). Geometries of neutral, anionic, and cationic amino acids with Au3 and Ag3 clusters were optimized using the DFT-B3LYP approach. The mixed basis set used here was denoted by 6-31+G** \u222aLANL2DZ. This work demonstrated that the interaction of amino acids with gold and silver clusters is governed by two major bonding factors:[ThinSpace] (a) the anchoring N-Au(Ag), O-Au(Ag), and S-Au(Ag) bonds and (b) the nonconventional N-H---Au(Ag) and O-H---Au(Ag) hydrogen bonds. Among the three forms of amino acids, anionic ones exhibited the most tendency to interact with the Au and Ag clusters. Natural bond orbital analysis was performed to calculate charge transfer, natural population analysis, and Wiberg bond indices of the complexes. Atoms-in-molecules theory was also applied to determine the nature of interactions. It was shown that these bonds are partially electrostatic and partially covalent.","10.1021/jp070306t","Interaction of Amino Acids with Gold and Silver Clusters","https://doi.org/10.1021/jp070306t",H.a(["Pakiari, A. H.","Jamshidi, Z."],b2),"2007/05/01",H.a([],b2),b5[13],H.a([],b2),2007),Z.b1("There has been much attention on unconventional hydrogen bond in literature, particularly on intermolecular dihydrogen bond. But there is less attention on intra-molecular dihydrogen bond. In this research, we have tried to find some rules in these types of interactions. Since, the investigations around life sciences are helpful, amino acids have chosen. There are important molecules in biology, biochemistry and medicine. In order to investigate the behavior of silicon atom in comparison with carbon, silicon derivatives of amino acids are taken into considerations. All ab initio calculations are done at B3lyp/6-311G** level of theory. The existences of dihydrogen bond in above species are also investigated by donor-acceptor interactions of Natural Bond Orbital analysis. We have found that some amino acids with intra-molecular dihydrogen bond are stable than original compound between 0.5 and 5kcal/mole.","10.1016/j.theochem.2004.06.053","Intra-molecular dihydrogen bond in the amino acid","https://www.sciencedirect.com/science/article/pii/S0166128004005160",H.a(["Pakiari, A.H.","Jamshidi, Z."],b2),"2004/10/11/",H.a([],b2),b5[38],H.a(["Intra-molecular dihydrogen bond","Amino acids"],b2),2004)],t.bm)})
